import React from 'react';

class App extends React.Component {
  componentDidMount() {
    fetch('http://locahost:3000/api/v1/accounts', {
      method: 'GET'
    })
    .then(response => response.json())
  }
  render() {
  return (
    <div className="App">
      App
    </div>
  );
 }
}

export default App;
